    [],nt"num_tags": 0,nt"name": "monthly-total-precipitation-observation-for-climate-prediction-center-cpcforecast-divisions",nt"isopen":
    false,nt"url": null,nt"notes": "This ASCII dataset contains monthly total
    precipitation for 102 Forecast Divisions within the conterminous U.S. It is derived
    from the monthly NCDC climate division data. These data are from daily reports from
    cooperative observers as well as first order stations. The CPC forecast division
    data combine NCDC climate divisions to yield regions of approximately equal area
    throughout the conterminous U.S. Data represent the approximate area average total
    monthly precipitation within each forecast division.",nt"owner_org": "e811f0b4-451f-4896-9e8f-fc6802837819",nt"extras":
